function reversedNum(num) {
  return (
    parseFloat(num.toString().split("").reverse().join("")) * Math.sign(num)
  );
}

arr = [];
function checkCompositerandom(num) {
  if (num == 1) {
    return false;
  } else if (num == 2) {
    return false;
  }

  for (var x = 2; x < num; x++) {
    if (num % x == 0) {
      return true;
    }
  }
  return false;
}

function compositeNumbers(num) {
  for (var j = 1; j < num; j++) {
    if (checkCompositerandom(j)) {
      arr.push(j);
    }
  }
  //console.log(arr[arr.length-1]);
  return JSON.stringify(arr[arr.length - 1]);
}

function checkComposite(num) {
  var i = 1;
  var count = 0;

  while (num >= i) {
    if (num % i == 0) count++;
    i++;
  }

  if (count > 2) {
    return "yes";
  } else {
    return "no";
  }
}

function playAgain() {
  localStorage.removeItem("CompositleUnlimitedgameState");
  window.localStorage.setItem("unlimitedActive", 1);

  //console.log(modifynext);
  location.reload();
}

function switchmode(element) {
  if (element.id == "unlimited") {
    $("game-app").hide();
    $("game-app-unlimited").show();
    window.history.replaceState(null, null, "?arg=unlimited");
  } else {
    $("game-app-unlimited").hide();
    $("game-app").show();
    window.history.replaceState(null, null, "?arg=daily");
  }
}

$(document).ready(function () {
  let searchParams = new URLSearchParams(window.location.search);
  if (searchParams.has("arg")) {
    let param = searchParams.get("arg");
    if (param == "unlimited") {
      $("game-app").hide();
      $("game-app-unlimited").show();
    } else {
      $("game-app-unlimited").hide();
      $("game-app").show();
    }
  } else {
    if ($("game-app").is(":hidden")) {
      var active = window.localStorage.getItem("unlimitedActive");
      if (active != null) {
        $("game-app").hide();
        $("game-app-unlimited").show();
      }
    }
  }
});

